/**
 * 检查缓存的模块
 */
harbors._cache = {};//存放缓存的对象
harbors._timeOut = {};//计时器队列

/**
 * 客户端缓存检查
 */
exports.memory = function(path,callback1,callback2){
    if(harbors._cache[path]){
        harbors.log('Cache : ' + path);
        callback1(harbors._cache[path]);
    }else{
        callback2();
    }
};
